%% Returns the Hourly Urls List

fb_hourly_urls_list() ->
	Data = fb_pageID(),
	UrlList = lists:map( fun(Url) -> hourlyUrl(Url)    end, Data),
	UrlList.
	
hourlyUrl(Url)->

	UrlC = case Url of
			{_, PageId} -> 
		    	"https://graph.facebook.com/"++ PageId ++"fields"; 
			true ->
	       		{error}   
		   end,
	UrlC.